import React from "react";
import styled, { ThemeProvider } from "styled-components";
import { Transition } from "arclight-react";

const Constraints = styled.div`
  width: 100%;
  height: 205px;
  top: 50%;
  left: 50%;
  background-color: blue;
`;

const PickCard = styled.div`
  position: relative;
  & img {
    opacity: 0.15;
    position: absolute;
    width: 100%;
    top: 0;
    left: 0;
  }
`;

export default class _ extends React.Component {
  render() {
    return (
      <ThemeProvider theme={{}}>
        <Transition>
          <Constraints>
            <PickCard>
              <img src={require("./img/yone.jpg")} />
              <img src={require("../../../config/assets/border.png")} />
            </PickCard>
          </Constraints>
        </Transition>
      </ThemeProvider>
    );
  }
}
